# ################################################################################
# function:	intraCluster(list, num)
# input:	clusters, cluster number
# obj:		look for common windows across NPs in a cluster
# ################################################################################
def intraCluster(cluster, num):
	print("Cluster", num, "Length:", len(cluster))

	newClust = []

	totalAVG = 0

	for i in range(0, len(cluster[0])):
		avg = 0 # keep track of avg. present windows
		for j in range(0, len(cluster)):
			avg += cluster[j][i]

		totalAVG += avg
	finalAVG = totalAVG / len(cluster[0])

	for i in range(0, len(cluster[0])):
		avg = 0 # keep track of avg. present windows
		for j in range(0, len(cluster)):
			avg += cluster[j][i]
		# print("Average:", avg)

		if avg >= finalAVG:
			newClust.append(1)
		else:
			newClust.append(0)

	# print("finalAVG", finalAVG)
	print(newClust)

	return newClust



# ################################################################################
# function:	interCluster(list1, list2)
# input:	intra clusters
# obj:		compare and contrast prominent blocks of windows in pairs of clusters
# ################################################################################
def interCluster(cluster1, cluster2):
	newClust = []

	for i in range(0, len(cluster1)):
		if cluster1[i] == 1 and cluster2[i] == 1:
			newClust.append(1)
		else:
			newClust.append(0)

	print(newClust)

	return newClust


